import React from 'react'
import {Nav} from 'react-bootstrap'
import {LinkContainer} from 'react-router-bootstrap'

const CheckOutSteps = ({step1, step2, step3, step4}) => {
  return (
    <Nav className='justify-content-center mb-4'>
      <Nav.Item>
        {step1 ? (
          <LinkContainer to='/login'>
            <Nav.Link>Intra in cont</Nav.Link>
          </LinkContainer>
        ) : (
          <Nav.Link disabled>Intra in cont</Nav.Link>
        )}
      </Nav.Item>

      <Nav.Item>
        {step2 ? (
          <LinkContainer to='/shipping'>
            <Nav.Link>Finalizeaza cumparaturile</Nav.Link>
          </LinkContainer>
        ) : (
          <Nav.Link disabled>Finalizeaza cumparaturile</Nav.Link>
        )}
      </Nav.Item>

      <Nav.Item>
        {step3 ? (
          <LinkContainer to='/payment'>
            <Nav.Link>Plata</Nav.Link>
          </LinkContainer>
        ) : (
          <Nav.Link disabled>Plata</Nav.Link>
        )}
      </Nav.Item>

      <Nav.Item>
        {step3 ? (
          <LinkContainer to='/placeorder'>
            <Nav.Link>Plaseaza comanda</Nav.Link>
          </LinkContainer>
        ) : (
          <Nav.Link disabled>Plaseaza comanda</Nav.Link>
        )}
      </Nav.Item>
    </Nav>
  )
}

export default CheckOutSteps
